import React from 'react';

export class Project extends React.Component {

    render() {
        return (
            <a>
                <div class="proj-panel left" data-sr="enter bottom move 50px wait 0.2s">
                    <img src="css/src/ford/ford.png" class="proj-panel-image shadow" />
                    <div id={this.props.id} class="overlay">
                        <div class="proj-text">
                            <div class="date-overlay">{this.props.date}</div>
                            {this.props.name}
                            <div class="text-overlay">{this.props.description}</div>
                            <div class="subtext-overlay">{this.props.tags.join()}</div>
                        </div>
                    </div>
                </div>
            </a>

        );
    }

}

export default Project;
